import React from 'react';
import '../styles/style.css';
import Nav from 'react-bootstrap/Nav';
const Navigation = () => {
  return (
    <div class='nav'>
      <Nav>
        <Nav.Item>
          <Nav.Link href='/'>Acceuil</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href='/articles'>Articles</Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
};

export default Navigation;
